-- ----------------------------
-- Table structure for pro_acceptance
-- ----------------------------
DROP TABLE IF EXISTS `pro_acceptance`;
CREATE TABLE `pro_acceptance`  (
  `Id` int NOT NULL AUTO_INCREMENT COMMENT '主键',
  `ProjectID` int NOT NULL COMMENT '项目id',
  `DeviceID` int NOT NULL COMMENT '设备id',
  `AcceptCategory` int NOT NULL COMMENT '验收类别',
  `AcceptDate` datetime(3) NOT NULL COMMENT '验收日期',
  `Acceptancer` int NOT NULL COMMENT '验收人员',
  `Qty` int NULL DEFAULT NULL COMMENT '验收数量',
  `CompletedDate` datetime(3) NOT NULL COMMENT '竣工日期',
  `AcceptResult` int NOT NULL COMMENT '验收结论',
  `FinalAbarbeitungDate` datetime(3) NOT NULL COMMENT '最终整改完成日期',
  `SignConfirmFile` int NOT NULL COMMENT '签字确认附件',
  `Remark` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `CreatedBy` int NOT NULL COMMENT '创建人',
  `CreatedAt` datetime(3) NOT NULL COMMENT '创建时间',
  `LastModifiedBy` int NOT NULL COMMENT '最后修改人',
  `LastModifiedAt` datetime(3) NOT NULL COMMENT '最后修改时间',
  `IsDeleted` bit(1) NOT NULL COMMENT '是否删除',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 23 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '项目交付信息';

