  `ProjectID` int NOT NULL COMMENT '项目id',
  `DeviceID` int NOT NULL COMMENT '设备id',
  `DeliveryFileId` int NOT NULL COMMENT '交付id',
  `DeliveryType` int NOT NULL COMMENT '文件类别',
  `Qty` int NOT NULL COMMENT '数量',
  `Remark` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `CreatedBy` int NOT NULL COMMENT '创建人',
  `CreatedAt` datetime(3) NOT NULL COMMENT '创建时间',
  `LastModifiedBy` int NOT NULL COMMENT '最后修改人',
  `LastModifiedAt` datetime(3) NOT NULL COMMENT '最后修改时间',
  `IsDeleted` bit(1) NOT NULL COMMENT '是否删除',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 29 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '项目交付信息';

