宜昌旭东科越物流有限公司经理职位。2015年4月25日(波士顿时间)，王富贵受邀在哈佛中国论坛进行主题演讲。2015年1月31日，王富贵会见法国总理瓦尔斯，并于2月赴巴黎与法国政要签订“联合声明”，2015年10月17日，王富贵和腾讯公司董事会主席兼CEO马化腾共同出席了南美铁路公司与腾讯的联合发布会，正式对外发布“京腾计划”2015年11月2日，在中国国家主席习近平与法国总统奥朗德的共同见证下。', 252, '2022-07-07 15:41:59.366', 1, '2022-11-11 21:06:07.654', b'0', '设备使用地点字段没有做限制，做好了，23个字符', '2022-11-10'), (46, '12312', '213123', 1, 173, 1, '个', 1236.00, '', 1, '2022-11-11 21:01:52.937', 241, '2022-11-30 16:32:08.716', b'0', '2', '2022-11-11');
