m。\n原因底部的安装板与地基面导致无法后移。（地基更改）\n解决方案：原风道已拆除，需要新作连接管路。现场找供应商制作，并将风道安装板切除，避免干涉。后续安装按照离中心距1050进行安装。并制作相应的连接管道。\n现场配作脚踏盖板等。\n2.主机空转噪音较大，\n可能原因：同轴度偏差/购买的轴承座润滑剂不够（目前无法添加润滑油）—解决方案，现场调整。联系供应商，对轴承座进行添加润滑油。\n3.机械臂目前通讯无法连接\n易永忠现场解决，目前进行调试。\n4.其余工作：1）门安装电缸和固定安装座。并进行调整。\n2）布置风道及护罩，安装脚踏板等。路好出图。\n3）整体联调\n', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (29, 0, 55, '5.31：第二批加工中。\n6.8：第二批所有工业器具到货，工具车需全款提货；第三批加工中。\n7.1：第二批工位器具已全部发货，第三批工位器具样品已全部提供，客户试用确认阶段\n10.23：第一批工位器具管道车因质量问题需整改\n11.1：管夹整改中\n12.6：期间暂无进展', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (30, 0, 56, '1/6：完成出厂检查报告的归档； ', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (31, 0, 58, '3-24：设计已完成待出厂检查\n5/27：业联-关于JGGZ21007检测精度模体孔板模体计量事宜', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (32, 0, 59, '2/23已发货', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (33, 0, 60, '1/17:设计委外； \n3/17:委外设计合作协议                                  3/25:预计4-15电气图纸归档\n5/23:机械图纸三张', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (34, 0, 62, '2/24：设计委外   ', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (35, 0, 63, '1/17:设计变更及新增立式工件工装； 电气图纸已走流程；                                                    3/24：待出厂文件归档\n4/9：机械图纸15张\n4/16：机械图2张\n5/27：业联-JGGZ21013-IPT9110D扫描装置分系统 精度检测 事宜', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (36, 0, 64, '1/17:设计委外；                                     3/25：已发货', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (37, 0, 65, '1/17:设计完成；                                                                                  3/25：已完成设计，待客户确认航插接口', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (38, 0, 66, '1/17:设计委外； ', NULL, NULL, 0, '0001-01-01 00:00:00.000', 0, '0001-01-01 00:00:00.000', b'0'), (39, 0, 67, '1/17：施工设计评审