INSERT INTO `sys_config` VALUES (1, 'display second', '10', '组装演示自动跳转时间', 0, '备注'), (5, 'cameraLocalPath', 'D:\\RW\\RWPAMS\\Camera\\', 'CCD视觉比对照片工控机上保存路径', 0, NULL), (8, 'pingServerTimer', '10', '工控机ping服务器的时间间隔秒数', 0, NULL), (9, 'ServerIP', '192.168.0.150', '服务器地址', 0, '192.168.0.53'), (10, 'PLCTag', 'Channel1.Device1.', 'PLC连接状态', 0, 'Channel1.Device1.PLCstatus'), (14, 'gbStepTimer', '1', '工步执行完成后跳转的时间', 0, ''), (15, 'LANIP', '192.168.0.', '局域网IP前缀 192.168.0.', 0, ''), (16, 'WebServerURL', 'http://192.168.0.30/', '访问管理系统的URL地址', 0, 'http://192.168.0.3/'), (17, 'screenTimer', '60', '生产线状态电子看板大屏显示数据刷新的时间秒数', 0, ''), (18, 'LoginIsUseCard', '0', '是否启用员工ID卡登陆，0：不启用；1：启用', 0, NULL), (19, 'isOriginalDismantling', '1', '是否要求原拆原配，1：是；0：否', 0, NULL), (20, 'isAssemblySystem', '1', '是否有装配管理系统，1：有；0：无装配系统', 0, NULL), (21, 'isFollowSystem', '1', '是否有追溯管理系统，1：有；0：无追溯系统', 0, NULL), (22, 'isUseGwDevice', '0', '是否启用工控机设备功能，0：不启用；1：启用', 0, NULL), (23, 'isGwHasThreeLight', '1', '装配系统的工位机是否有三色灯', 0, NULL), (24, 'TorqueModel', 'SP', '扭力扳手型号， 没有扭力扳手则空;\r\n上海九亭：(Matou_CVI3)马头牌CVI3;\r\n宁波：SP', 0, ''), (25, 'TorqueIP', '192.168.3.7', '扭力扳手server IP；\r\n扭力扳手用socket TCP的方式通讯，就要设置此IP；\r\n若有多个扭力扳手，可以把每个扭力扳手的IP设置成一样的', 0, ''), (26, 'TorquePort', '4330', '扭力扳手server port端口；\r\n扭力扳手用socket TCP的方式通讯，就要设置此端口；\r\n若有多个扭力扳手，可以把每个扭力扳手的端口设置成一样的', 0, ''), (27, 'CheckGWHasCheck', '1', '追溯系统的检验工位是否要检验是否合格的功能，0：不启用；1：启用若不启用，则检验列不显示，并且物料盒来料扫码后自动检验合格', 0, NULL), (30, 'BatchHasCopy', '1', '追溯系统的配料区工位是否要有物料盒扫码自动Copy的功能，0：不启用；1：启用\r\n若启用，则物料盒在配料界面扫码后，自动带到右边的待配列表，\r\n若不启用，则物料盒在配料界面扫码后，自动解绑，不会带到右边的待配列表。', 0, ''), (31, 'followProductInfoCol', 'pf_carModelID,pf_carNo,pf_groupNo,pf_factoryID,pf_stampNo', '追溯、装配产品主信息动态显示参数，参数值为follow_productInfo表的字段名，用逗号隔开；动态生成的控件类型以字段的数据库类型来识别', 0, 'pf_carModelID,pf_carNo,pf_groupNo,pf_factoryID,pf_stampNo'), (32, 'AmsStempNoConfirm', '1', '追溯系统的总装区工位是否启用组件编码确认的功能，0：不启用；1：启用；若启用，则列表显示“确认”按钮列功能，并且列表显示所有关键组件的编码信息，人工确认；若不启用，则列表查出工位绑定的关键部件及物料盒信息，并不显示“确认”列', 0, ''), (33, 'followProductInfoName', '车 型,车 号,编 组,厂 商,主部件钢印号', '追溯、装配产品主信息动态显示参数，参数值为follow_productInfo表的字段名说明（即动态显示控件的label内容），用逗号隔开', 0, '车 型,车 号,编 组,厂 商,主部件钢印号'), (34, 'AllWarehouse', '11,12,13,14', '成品缓存区最大仓库位号， 总共4个：11,12,13,14', 0, ''), (35, 'curWarehouse', '12', '成品缓存区当前仓库号，11~14', 0, ''), (36, 'followProductInfoCombox', 'carModel,factory', '追溯、装配产品主信息动态显示参数，参数值为follow_productInfo表字段的下拉类型的基础数据字典类型名称，用逗号隔开；动态生成的控件类型以字段的数据库类型来识别', 0, NULL), (37, 'AGVServerIP', '192.168.0.2', 'AGV呼叫系统socket服务器地址', 0, '192.168.10.200'), (38, 'AGVServerPort', '502', 'AGV呼叫系统socket端口号', 0, '502，8000'), (39, 'AGVCallSocketString', '00 00 00 00 00 06 00 05 00 {0} FF 00', '发货区呼叫AGV小车的socket发送/接收指令代码,16进制字符串代码，由AGV小车提供，仓库号位用{0}代替', 0, ''), (40, 'AGVCancelSocketString', '00 00 00 00 00 06 00 05 00 {0} 00 00', '发货区取消呼叫AGV小车的socket发送/接收指令代码,16进制字符串代码，由AGV小车提供，仓库号位用{0}代替', 0, ''), (41, 'AGVStartSocketString', '00 00 00 00 00 06 00 05 00 {0} FD 00', '发货区AGV小车工位派料完成（即指派AGV出发，不是在AGV待办任务列表中）的socket接收指令代码,16进制字符串代码，由AGV小车提供，仓库号位用{0}代替', 0, ''), (42, 'AGVRepeatSocketString', '00 00 00 00 00 06 00 05 00 {0} FE 00', '发货区呼叫AGV小车重复（该呼叫信息在列表已存在，不能重复呼叫）的socket接收指令代码,16进制字符串代码，由AGV小车提供，仓库号位用{0}代替', 0, ''), (43, 'AGVArriveSocketString', '00 00 00 00 00 06 00 05 00 {0} FC 00', '发货区AGV小车到达指定仓库号的socket发送/接收指令代码,16进制字符串代码，由AGV小车提供，仓库号位用{0}代替', 0, ''), (44, 'ConveyorLineAmsAreaStart', 'Channel2.Device1.AmsStart', '组装区输送线始能OPC点位名称；组装区皮带输送线始能信号（即读码器扫码标志），当信息为1时，可以开始读取条形码字符；为0时不读', 0, ''), (45, 'ConveyorLineAmsAreaBarcode', 'Channel2.Device1.barcode1,Channel2.Device1.barcode2,Channel2.Device1.barcode3,Channel2.Device1.barcode4,Channel2.Device1.barcode5,Channel2.Device1.barcode6,Channel2.Device1.barcode7,Channel2.Device1.barcode8', '组装区输送线扫码字符读取OPC点位名称；8位字符，8个点位， 每个点位间用英文逗号隔开', 0, NULL), (46, 'ConveyorLineAmsAreaGw', 'Channel2.Device1.AmsGw', '阀类组装区皮带输送线指定的组装工位OPC点位信息', 0, ''), (47, 'ConveyorLineConfigs', 'ConveyorLineAmsAreaStart,ConveyorLineAmsAreaBarcode,ConveyorLineAmsAreaGw', '输送线所有OPC点位名称参数，用逗号隔开', 0, ''), (48, 'ConveyorLineAreas', 'assemblyArea', '输送线区域', 0, ''), (49, 'clearnerOPCtags', 'Channel1.Device1.clearTimes,Channel1.Device1.setClearTimes,Channel1.Device1.totalClearTimes', 'clearnerOPCtags清洗机OPC所有点位全称信息，用逗号隔开，点位顺序为清洗次数、清洗设定值、累计清洗数；Channel1.Device1.Status_1,Channel1.Device1.Status_2,Channel1.Device1.Status_3', 0, ''), (50, 'AGVBeOutSocketString', '00 00 00 00 00 06 00 05 00 {0} FB 00', '发货区AGV小车不在待命点的socket发送/接收指令代码,16进制字符串代码，由AGV小车提供，仓库号位用{0}代替', 0, ''), (51, 'Torque_SPCOM', 'COM7', '宁波手动扭力扳手型号的传输COM口', 0, ''), (52, 'cfg_errorTimer', '0.5', '报警峰鸣器鸣叫秒数时间', 0, NULL), (53, 'allWarehouseChinese', '缓存区工位一,缓存区工位二,缓存区工位三,缓存区工位四', 'allWarehouseChinese	成品缓存区工位中文名， 总共4个：缓存区工位一,缓存区工位二,缓存区工位三,缓存区工位四', 0, NULL), (56, 'ExpireReminderDay', '30', '设备到期提醒天数', 0, NULL), (58, 'InCommingGW', 'yuchai', '存储来料区的工位编码信息，用于平板获取工位ID', 0, NULL), (59, 'InCommingProductInfoCol', 'pf_carModelID,pf_carNo,pf_weight,pf_date', '平板来料区动态显示参数，参数值为InComming_productInfo表的字段名，用逗号隔开；动态生成的控件类型以字段的数据库类型来识别', 0, NULL), (60, 'InCommingProductInfoName', '车型,车号,重量,产品日期', '平板来料区动态显示参数，参数值为InComming_productInfo表的字段名说明（即动态显示控件的label内容），用逗号隔开', 0, NULL), (61, 'InCommingProductInfoCombox', 'carModel', '平板来料区动态显示参数，参数值为InComming_productInfo表字段的下拉类型的基础数据字典类型名称，用逗号隔开；动态生成的控件类型以字段的数据库类型来识别', 0, NULL), (62, 'InCommingProductInfoCssStyle', '5,3,5,3', '平板来料区动态显示样式，参数值为页面控件左右排版格式有多少控件就需要设置多少个控件样式，5代表控件放置左边3代表控件放置右边，用逗号隔开；', 0, '5代表控件放置左边    3代表控件放置右边'), (63, 'IsShowBatching', '0', '分拣配料区是否需要显示检验说明列表，0：不显示；1：显示', 0, NULL), (64, 'IsShowComponent', '0', '分拣配料区是否需要显示部件名称、编码，0：不显示；1：显示', 0, '由于北京瀛海项目检修单元制动机 存在多个大部件需要进行绑条码卡设置为不显示'), (65, 'IsAssembly', '0', '小部件组装区是否启动扫入条码卡后带出上一区域所有部件；0：不启用，1：启用', 0, NULL), (66, 'isUseBarcodeAMSGwID', '0', '使用条形码信息中的“物料框的组装工位”来区分小部件组装工位;  0为不启用，1为启用；启用后需要配置条形码卡表的c_AmsGwID 来设置小部件组装工位ID用以区分条码所属那个工位', 0, '使用条形码信息中的“物料框的组装工位”来区分小部件组装工位;  0为不启用，1为启用；启用后需要配置条形码卡表的c_AmsGwID 来设置小部件组装工位ID用以区分条码所属那个工位'), (67, 'HomePageTitle', 'RWAMS 装配管理系统', '1', 0, '润伟生产过程管理信息系统'), (68, 'IsEnableConveyorLine', '0', '是否启用输送线：0：不启用；1：启用', 0, '有些项目没